import React from "react";
import styled from "styled-components";

export const Footer = () => {
  return (
    <FooterWrapper>
      <p>
        <A
          href="https://www.howmanypeopleareinspacerightnow.com/peopleinspace.json"
          target="_blank"
          rel="noopener noreferrer"
        >
          API
        </A>
      </p>
    </FooterWrapper>
  );
};

const FooterWrapper = styled.footer`
  display: flex;
  align-items: center;
  justify-content: center;
  height: 50px;
  color: white;
  background: #000;
  width: 100%;
  text-align: center;
`;
const A = styled.a` display: inline-block;
text-shadow: none;
font-size: 1.75vw;

position: relative;
display: inline-block;
z-index: 25;
color: #fff;
font-weight: bolder;
font-family: "Righteous", cursive;
letter-spacing: 2px;

@media (max-width: 668px) {
  font-size: 14px;
  letter-spacing: 2px;`;
